    showMedia = (data) => {
        debugger;
        console.log(data)
    }

    render() {
        return (
        <div className="list-div">
            {this.props.results.map((item, index) => <Item key={item.trackId || index} 
            showMedia={this.showMedia} {...item} />)}
        </div>
